import React from "react";
import img from "../../images/Portfolio2022_Preview.jpg";

const Portfolio2022 = () => {
  return (
    <div>
      <a href="https://bassebasse123.github.io/portfoliopage/">
        <div className="card">
          <img className="preview" src={img} alt=""></img>

          <div className="text text-one">
            <h3>Pure HTML/CSS Portfolio from 2022</h3>
            <p>
              Using an API for Blizzard's Hearthstone game to create a
              collection of the cards. Using the useReduce and useState hook,
              the collection can be filtered by mana costs, rarity, classes and
              searchterm to show specific cards only.
            </p>
          </div>
        </div>
      </a>
    </div>
  );
};

export default Portfolio2022;
